  input: 'TEXT,F3A,,"In response to your letter dated November 8, 2005 please note
    the following information regarding this amendment:  The debt listed to Ourso
    Beychok Inc for $3500 was a duplicate invoice booked in error by the Committee.  The
    vendor has been paid the full amount owed by the Committee.  A non-cash accrual
    was booked to remove the duplicate.  You have stated that certian contributors
    are itemizing with incorrect aggregate totals.  The Committee for the Preservation
    of Capitalism shows a $0 aggregate due to the fact that they received a $5000
    refund from the Committee on November 2004 at the beginning of the cycle.  As
    we discussed in our phone conversation, we are unable to force the system to show
    a $5000 aggregate total for the cycle when this refund is included.  The Committee
    is aware that CPC-PAC has given $5000 so far this cycle and that their available
    limit to the Committee has been reduced by $5000.  Thank you for your assistance
    with this matter.  Please contact me with any further questions or concerns.  Thank
    You."'
